import React from "react";

const CardOrder = ({ orders }) => {
  return (
    <div className="container">
      {orders.map((order) => 
      (
        <div key={order.id} className="col-12 col-sm-4 pt-2">{order.table}
        <div className="card p-3">
        <div className="card-header">
        {order.table}
        </div>
        </div>
        </div>
      ))}
    </div>
  );
};

export default CardOrder;
